async function arrayReverse(array: number[]) {
"use speedyjs";

for (let i = 0; i < array.length / 2; ++i) {
swap(array, i, array.length - i - 1);
}

return array;
}

function swap(array: number[], i: int, j: int) {
"use speedyjs";

const tmp = array[i];
array[i] = array[j];
array[j] = tmp;
}

arrayReverse([1, 2, 3, 4, 5]).then(result => console.log(result));
